import React,{useEffect,useState} from 'react'

const VansList = () => {
    const [vans, setVans] = useState([])
    useEffect(() => {
        fetch('/api/vans')
            .then(response => response.json())
        .then(data => setVans(data))
},[])


  return (
    <div>
          <h1>Van goes here</h1>
          {vans}
    </div>
  )
}

export default VansList
